import React, { useState } from 'react';
import { FaStar } from 'react-icons/fa';
import Etudiants from '../etudiants.jpg';
import '../../App.css';


const Contact = () => {
    const [formValues, setFormValues] = useState({
        name: '',
        email: '',
        message: '',
      });      

    const [rating, setRating] = useState(null);
    const [hover, setHover] = useState(null);

  return (
    <div className="grid grid-cols-6 gap-10 items-center">
    <div className='col-span-1'>
    </div>
    <div className=" col-span-2 body my-4 p-6 bg-white rounded-md ">
      <h2 className="text-4xl  mb-10 mt-20  font-serif  font-extrabold  text-gray-600">
        Contact Us
      </h2>
      <form>
        <div className="mt-10">
          <label htmlFor="name" className="absolute w-4/12 h-16  hover:trans block text-slate-500 hover:text-gray-700 hover:font-bold mb-2 ml-4 mt-2 ">
            Name
          </label>
          <input
            type="text"
            id="name"
            name="name"
            value={formValues.name}
            onChange={(e) =>
              setFormValues({
                ...formValues,
                name: e.target.value,
              })
            }
            className={`border rounded-md py-2 px-3 w-full ${formValues.name ? 'transform -translate-y-4 text-gray-600 text-sm' : ''}`}
          />
        </div>
        <div className="mt-10">
          <label htmlFor="email" className=" absolute w-4/12 h-16  hover:trans  block text-slate-500 hover:text-gray-700 hover:font-bold mb-2 ml-4 mt-2">
            Email
          </label>
          <input
            type="email"
            id="email"
            name="email"
            className="border rounded-md py-2 px-3 w-full"
          />
        </div>
        <div className="mt-10">
          <label htmlFor="message" className=" absolute w-4/12 h-40  hover:trans block text-slate-500 hover:text-gray-700 hover:font-bold mb-2 ml-4 mt-2">
            Message
          </label>
          <textarea
            id="message"
            name="message"
            className="border rounded-md py-2 px-3 w-full h-32 resize-none"
          ></textarea>
        </div>


        <div className="justify-center">
      {[...Array(5)].map((star, index) => {
        const ratingValue = index + 1;

        return (
          <label key={ratingValue}>
            <input
            className='appearance-none '
              type="radio"
              name="rating"
              value={ratingValue}
              onClick={() => setRating(ratingValue)}
            />
            <FaStar
              className="star inline justify-center"
              color={ratingValue <= (hover || rating) ? '#ffc107' : '#e4e5e9'}
              size={25}
              onMouseEnter={() => setHover(ratingValue)}
              onMouseLeave={() => setHover(null)}
            />
          </label>
        );
      })}
      <p className='m-10 justify-center'>
        {whichemoji(rating)}
      </p>
    </div>


        <button
          type="submit"
          className="hover:bg-emerald-700 ease-in duration-300 shadow-lg shadow-gray-800 row-span-1 bg-emerald-900 text-white font-bold py-2 px-4 rounded"
        >
          Submit
        </button>
      </form>
    </div>
    <div className='col-span-2 rounded-md shadow-md '>
        <img className=''
        src={Etudiants} alt="students img" >
        </img>
    </div>
    <div className='col-span-1'>
    </div>
    </div>
  );
};

function whichemoji(props) {
    if (props === 1) {
      return (
        <div>
          <p>‚òπÔ∏è</p>
        </div>
      );
    } 
    else if (props === 2) {
      return (
        <div>
          <p>üôÅ</p>
        </div>
      );
    }
    else if (props === 3) {
      return (
        <div>
          <p>üôÇ</p>
        </div>
      );
    }
    else if (props === 4) {
      return (
        <div>
          <p>üòä</p>
        </div>
      );
    }
    else if (props === 5) {
      return (
        <div>
          <p>ü§© Thank you</p>
        </div>
      );
    }
  }

export default Contact;
